import { useState } from "react";
import Row from "../components/Row";

const App = () => {
  const [rowNum, setRowNum] = useState(8);
  const board = new Array(rowNum);
  const row = new Array(rowNum);
  row.fill("o");
  board.fill(row);
  console.log(board);
  return <div className="main">hello</div>;
};

export default App;
